import{_ as a,o as t,c as o,z as e,a as r}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 4.1-337 Search warrants.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/4.1-337.md","filePath":"vacode/4.1-337.md"}'),s={name:"vacode/4.1-337.md"},n=e("h1",{id:"§-4-1-337-search-warrants",tabindex:"-1"},[r("§ 4.1-337 Search warrants. "),e("a",{class:"header-anchor",href:"#§-4-1-337-search-warrants","aria-label":'Permalink to "§ 4.1-337 Search warrants."'},"​")],-1),c=e("p",null,"A. If complaint on oath is made that alcoholic beverages are being manufactured, sold, kept, stored, or in any manner held, used or concealed in a particular house, or other place, in violation of law, the judge, magistrate, or other person having authority to issue criminal warrants, to whom such complaint is made, if satisfied that there is a probable cause for such belief, shall issue a warrant to search such house or other place for alcoholic beverages. Such warrants, except as herein otherwise provided, shall be issued, directed and executed in accordance with the laws of the Commonwealth pertaining to search warrants.",-1),i=e("p",null,"B. Warrants issued under this subtitle for the search of any automobile, boat, conveyance or vehicle, whether of like kind or not, or for the search of any article of baggage, whether of like kind or not, for alcoholic beverages, may be executed in any part of the Commonwealth where they are overtaken and shall be made returnable before any judge within whose jurisdiction such automobile, boat, conveyance, vehicle, truck, or article of baggage, or any of them, was transported or attempted to be transported contrary to law.",-1),h=e("p",null,"Code 1950, § 4-54; 1993, c. 866.",-1),l=[n,c,i,h];function d(u,f,m,p,w,_){return t(),o("div",null,l)}const v=a(s,[["render",d]]);export{g as __pageData,v as default};
